import React from 'react'
import { Description, Headergrid, Headings } from './Webdevelopment.element'


function Component_header(){
 return(
    <Headergrid>
        <Headings>
            Problems we solve
        </Headings>
        <Description>
            Design, development and strategy solutions that deliver results
        </Description>
    </Headergrid>
 )
}

export default Component_header;
